import React from 'react';
import Card from './Card';

const CardList = ({ robots }) => {
  const CardsArray = robots.map((user, i) => {
    return (
      <Card id={robots[i].id} name={robots[i].name} age={robots[i].age} />
    )
  })
  return (
    <div>
      {CardsArray}
    </div>
  );
}

export default CardList;
